import { Button, Col, Row } from 'antd';
import { SearchOutlined, InfoCircleOutlined } from '@ant-design/icons';


const Home = () => {
    return (
        <div>
            <Row align="middle" style={{ height: '100%', height: '100%', textAlign: 'center' }}>
                <Col>
                    <Row>
                        <Button type="primary" icon={<SearchOutlined />} size="large" shape="round">현재위치정보 이용하여 둘러보기</Button>

                    </Row>
                    <Row>
                        <Button size="large" icon={<InfoCircleOutlined />} shape="round">구장 둘러보기</Button>

                    </Row>
                </Col>
                <Col>
                </Col>
            </Row>
        </div>
    );
};

export default Home;
